import "./Table.css";
import Form from "../Form/Form";

export default function Table(props) {
  return (
    <div className="containerTable">
      <table >
        <div>
          <tr>
            <th>{props.name}</th>
          </tr>
        </div>
        <div>
          <tr>
            <td>
              <Form type="text" input="table" place="Type" />
            </td>
          </tr>
        </div>
      </table>
    </div>
  );
}
